description:
Denna psykologiska thriller handlar om en man som drabbas av en sjukdom 
och befinner sig helt vaken och narvarande, men helt paralyserad under en hjartoperation han genomgar. Samtidigt maste hans unga fru kampa mot de 
demoner som omger henne.

Med bl.a. Hayden Christensen, Jessica Alba och Terence Howard.

